import os, base64, zlib

# Compressed project data
DATA = ""

import json
files = json.loads(zlib.decompress(base64.b64decode(DATA)).decode("utf-8"))

project_dir = "ai-powered-mind"
for rel_path, content in files.items():
    full_path = os.path.join(project_dir, rel_path)
    os.makedirs(os.path.dirname(full_path), exist_ok=True)
    with open(full_path, "w") as f:
        f.write(content)
    print(f"  Created: {rel_path}")

print()
print("Project created successfully in ./ai-powered-mind/")
print()
print("Next steps:")
print("  1. Install MongoDB: https://www.mongodb.com/try/download/community")
print("  2. cd ai-powered-mind/backend && pip install -r requirements.txt")
print("  3. uvicorn server:app --host 0.0.0.0 --port 8001 --reload")
print("  4. (new terminal) cd ai-powered-mind/frontend && yarn install && yarn start")
print("  5. Open http://localhost:3000")